function App() {
  // Define the dark theme
const darkTheme = extendTheme({
  config: {
    initialColorMode: "dark",
    useSystemColorMode: false,
  },
});

return (
<ChakraProvider theme={darkTheme}>
      <Box minHeight="100vh">
        <Navbar />
        <LandingPage />
        < About />
        < Program />
        < Upcoming />
        < GetInvolvedSection />
        < Sponsor />
        < Team />
        < Footer />
        {/* Your other components and routes go here */}
      </Box>
    </ChakraProvider>
  );
}
